import React from "react";

class User extends React.Component  
{
  render()
  {
    return( 
    <div className="user" > 
        <h3>{el.firstname} {el.lastname}</h3>
        <p>{el.bio}</p>
        <b>{el.isHappy ? "Счастлив" : "Не особо"}</b>
    </div>)
    
  }

}

export default User
